import { Component } from '@angular/core';
import { UserService } from '../user.service';


@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  constructor(private userService: UserService) {}

  onDeleteAccount() {
    // Извикайте метода за изтриване на акаунта от UserService
    this.userService.deleteAccount();
    // Тук можете да направите каквото смятате за необходимо, например да пренасочите потребителя към друга страница или да изведете съобщение за успешно изтриване на акаунта.
  }
}
<div class="container">
  <h1>Choose your car</h1>
   <nav>
    <div>
      <a routerLink="/sport-cars">Sports Cars</a>
      <a routerLink="/suv-cars">SUV Cars</a>
      <a routerLink="/hybrid-cars">Hybrid Cars</a>
      <a routerLink="/logout">Logout</a>
      <a routerLink="/delete-account" (click)="onDeleteAccount()">Delete Account</a>
    </div>
  </nav>
